import ArticleCard from 'components/common/ArticleCard';
import { LeftArticleArrow, RightArticleArrow } from 'pages/home/ArticleArrows';
import React from 'react';
import Slider from 'react-slick';
import styled from 'styled-components';

function CompanyRec() {
	const settings = {
		dots: false,
		infinite: true,
		speed: 600,
		slidesToShow: 2,
		slidesToScroll: 2,
		nextArrow: <RightArticleArrow />,
		prevArrow: <LeftArticleArrow />,
		arrows: true,
	};

	return (
		<ComponentsWrapper>
			<CustomSlider {...settings}>
				<ArticleCard type="List" />
				<ArticleCard type="List" />
				<ArticleCard type="List" />
			</CustomSlider>
		</ComponentsWrapper>
	);
}

const ComponentsWrapper = styled.div`
	position: relative;
`;

const CustomSlider = styled(Slider)`
	z-index: 1;
	position: relative;
	display: block;
	box-sizing: border-box;
	user-select: none;
	touch-action: pan-y;
	padding-top: 70px;
	top: -40px;
	overflow-x: hidden;

	.slick-slide {
		float: left;
		height: 100%;
		min-height: 1px;
		display: inline-block;
	}
`;

export default CompanyRec;
